import React from 'react';
import './App.css';
import Editor from './components/Editor';
import ResizableBox from './components/OutputPanel';
import { themeOptions, languageOptions } from './components/options';






class App extends React.Component {

  render() {

    return (
      <div id="App">

        {/*Header bar on top of the screen*/}
        <div id="headerBar">

          <div id="logo"></div>

          <div>
            <div id="dropdown-containers">

            </div>
            <button id="runButton">Run Code</button>
          </div>

        </div>


        {/*Containing the code editor and the output panel*/}
        <div id="workspace">

          <div></div>
          <Editor id="editor" />

          <ResizableBox id="outputPanel">
            <div id="output">Output:</div>
          </ResizableBox>

        </div>

      </div>
    );
  }
}




export default App;
